Column.Formula:
LET $current := ARRAY([EFormType], [RecordID]);
LET $descriptionColumns := 
HASH(
	"Contract",  					"Contract Number", 
	"Vendor", 						"Company Name",
	"Procurement", 					"Procurement Number",
	"Project", 						"Project Number",
    "Evaluation", 		    		"Description",
  	"Information Request",  		"File No.", 
	"Subpoena", 					"File No.",
	"Privacy Incident", 			"File No."
); 

LET $altFormName:= HASH(
  	"Insurance",	"Compliance"
  );

LET $getLabelText := $(eFormType, recordID)
(
  	LET $targetColumn := HASH_GET($descriptionColumns, $eFormType);
  	RETURN 
  	IF( $targetColumn = NULL, NULL,
		LET $isthisRecord := ARRAY($eFormType, $recordID) = $current;
		LET $title:= 
		IF( $isthisRecord = TRUE, 
			CURRENT_VALUE($targetColumn),
			ARRAY_FIRST(DB_LOOKUP(
				ARRAY($targetColumn),
				$eFormType, 
				"[RecordID] FAST_EQUAL_TO " & $recordID
			))
		  );
		//shortern the descriptive label/ title
		LET $charCount := LEN($title);
		LET $titleArray := SPLIT($title, " ");
		LET $wordCount := ARRAY_LENGTH($titleArray);

		LET $charLimit := 30; 
		LET $wordLimit := ARRAY_LENGTH( SPLIT( LEFT($title, $charLimit), " ") );

	  RETURN //ARRAY_TAKE($titleArray, $wordLimit)
		IF(
			$wordCount <= $wordLimit, $title,
			ARRAY_JOIN(
				ARRAY_TAKE($titleArray, $wordLimit), " "
			)& " ..."
		)
	  )

); 

LET $getReadAccess := $(eFormType, recordID)
( EBMS_GET_EFORMRECORD_PERMISSION($eFormType, $recordID, "read"));

LET $currentDes := CALL($getLabelText, [EFormType], [RecordID]);
LET $currentAccess := FALSE;

RETURN
IF(
	[Parent Structure] <> NULL, [Parent Structure],
  	(

	  LET $parent := 
	  IF( 
		[RecordID] > 0, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($current), ARRAY_INDEX($current, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
				  )

			  )
	  )); 

	  LET $gParent := 
	  IF( 
		 $parent <> NULL, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($parent), ARRAY_INDEX($parent, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
			  )
		  )
	  )); 

	  LET $hash :=  
	  HASH_MERGE(
		  IF( $parent <> NULL, HASH("parent", 	$parent)),
		  IF( $gParent <> NULL, HASH("gparent", 	$gParent))
	  );

	  LET $parentStructure := 	//2nd instance
	  IF( 
		  ARRAY_LENGTH(HASH_KEYS($hash)) >0, $hash, NULL
	  );

	  LET $parentData:= 
	  ARRAY_WHERE(
		ARRAY(
			$gParent, 
			$parent, 
			ARRAY_CONCAT($current, $currentDes, $currentAccess),
		), $(i,item) $item <> NULL
	   );


	  LET $parentChain:=
		ARRAY_SELECT(
			  $parentData, $(i, item)
			  ARRAY_TAKE($item, 2)
	   );


	  LET $parentLinks :=
	  ARRAY_SELECT(
		  $parentData, $(i, item) 
			  LET $eFormType 		:= ARRAY_FIRST($item);
			  LET $recordID 		:= ARRAY_INDEX($item, 2);
			  LET $descriptiveLabel := ARRAY_INDEX($item, 3);
			  LET $hasReadAccess	:= ARRAY_INDEX($item, 4);
			  LET $URL	:= "records/" & URLENCODE($eFormType) & "/" & $recordID ;
			  LET $showEFormType := $eFormType <> "Vendor";

			  LET $labelColour := 
				  IF(
				   AND($eFormType = [EFormType], $recordID = [RecordID]),
					  "background: #ffffff; color: #5D5D5D;",
					 $hasReadAccess = TRUE,
					  "background: #ffffff; color: #4D87B7;",
					  "background: #ffffff; color: #5D5D5D;"

				  );



			  LET $labeltext:= 
					  IF( $showEFormType == TRUE, " " & COALESCE(HASH_GET($altFormName, $eFormType), $eFormType) ) &
					  IF(NOT(ISBLANK($descriptiveLabel)), " " & $descriptiveLabel);

			  LET $label :=  
				  "<span style=""margin-left: 5px;" & $labelColour & """>" &
				  HTMLENCODE($labeltext) & 
				  "</span>";

			  RETURN 
			  IF( 
				  $hasReadAccess == TRUE, 
				  "<a style=""text-decoration-line: none;"" href=" & HTMLENCODE($URL) & ">" & $label & "</a>",
				  $label 
			  )
	  );

	   LET $separator :=   "<svg style=""vertical-align: bottom; margin-left: 5px; height: 18px;"" xmlns=""http://www.w3.org/2000/svg"" viewBox=""0 0 256 512""><path fill=""#5D5D5D"" d=""M246.6 278.6c12.5-12.5 12.5-32.8 0-45.3l-128-128c-9.2-9.2-22.9-11.9-34.9-6.9s-19.8 16.6-19.8 29.6l0 256c0 12.9 7.8 24.6 19.8 29.6s25.7 2.2 34.9-6.9l128-128z""/></svg>";

	  LET $breadcrumb := "<div style=""height: 23px; padding-left: 5px; font-size: 10pt; color: #5D5D5D; "">You are here:" & ARRAY_JOIN($parentLinks, $separator) & "</div>";

	  RETURN 
	  HASH(
		  "Parent Structure",	$parentStructure,
		  "Parent Data", 		$parentData,
		  "Parent Chain",		$parentChain,
		  "Breadcrumb",		$breadcrumb
		)
	 )
)

Binding.Expression:
LET $target := EBMS_GET_BASE_URL(); 
LET $system := RIGHT($target, LEN($target) - FINDR("/", $target));

RETURN "System: " & $system

FieldEntry.Formula:
LET $data := 
DB_REPORT(
	ARRAY(
		"[ActualUsername]",
		"COUNT([Action])"
	), 
	"sys.Audit",
	"[DateCreated] >= " & DB_ENCODECONSTANT(DATEADD("month", -1, NOW()))
	& " AND [ActualUsername] IS NOT EMPTY"
	& " AND [ActualUsername] <> 'emailapproval'"
	& " AND [ActualUsername] <> 'system'"
	& " AND [ActualUsername] <> 'scheduler'"
	& " AND [ActualUsername] <> 'external'"
	);


LET $filtered := 
ARRAY_WHERE(
	$data, $(i, item) 
	AND(
		IF(
		  	[User Activity - Exclude Cluster Admin] = TRUE, 
		    LEFT(ARRAY_INDEX($item, 1), 6) <> "admin-",
		    TRUE
		),
		IF(
		  	[User Activity - Exclude Guest Accounts] = TRUE, 
		    DB_LOOKUP("Type", "sys.Roles", HASH("Identity", ARRAY_INDEX($item, 1))) <> "GUEST",
		  	TRUE
		)
	)
);

LET $sorted :=  
ARRAY_SORTDESC(
	$filtered, 
	$(item) 
	ARRAY_INDEX($item, 2)
);

LET $scores := ARRAY_INDEX(ARRAY_TRANSPOSE($sorted), 2);
LET $average := AVERAGE($scores); 
LET $greatestScore := GREATEST($scores); 

LET $scored := 
ARRAY_SELECT(
	$sorted, $(i, item) 

	LET $username := ARRAY_INDEX($item, 1); 
	LET $systemActions := ARRAY_INDEX($item, 2); 
	LET $displayName := EBMS_GET_ROLE_DISPLAYNAME($username);


	LET $statement := 
	IF( 
		$systemActions > 250, "Very high activity",
		$systemActions > 100, "High activity", 
		$systemActions > 50, "Moderate-high activity",
		$systemActions > 20,  "Moderate activity",
		$systemActions > 10, "Low activity",
		"Very low activity"
	);	

	RETURN 
	ARRAY(
		$username,
		$displayName,
		$systemActions,
		$statement
	)
);

LET $rows := 
ARRAY_SELECT(
	$scored, $(i, item)

	LET $statement := ARRAY_INDEX($item, 4);

	LET $colour := 
	IF( 
		$statement = "Very low activity", "#fc6042",
		$statement = "Low activity", "#fc6042",
		$statement = "Moderate activity", "#fcb941",
		$statement = "Moderate-high activity", "#41a67c",
		$statement = "High activity", "#41a67c", 
		$statement = "Very high activity", "#2c82c9"
	);	

	RETURN 
	ARRAY_SELECT(
		$item, $(c, cell)
		HASH(
			"value", $cell, 
			"colour", $colour
		)
	)
);

LET $columns := 
ARRAY(
	HASH("heading", "Username", 			"width", 200),
	HASH("heading", "Display Name",	 	"width", 200),
	HASH("heading", "System Actions", 	"width", 200),
	HASH("heading", "Result", 				"width", 200)
); 

RETURN 
HASH(
	"columns", $columns, 
	"rows", $rows
)

LET $users := 
DB_LOOKUPALL(
	"Username", 
	"sys.Users"
);

LET $data := 
ARRAY_SELECT(
  $users, $(i, user) 

  (
	LET $lastLoginDate := 
    DB_LOOKUP(
		"DateCreated",
		"sys.Audit",
		"[DateCreated] >= " & DB_ENCODECONSTANT(DATEADD("year", -2, NOW()))
		& " AND ([Action] = 'ClusterLogin'"
		& " OR [Action] = 'Login')"
		& " AND [ActualUsername] = " & DB_ENCODECONSTANT($user)
	);

	RETURN 
	ARRAY($user, $lastLoginDate)

	)
);

LET $filtered := 
ARRAY_WHERE(
	$data, $(i, item) 
	AND(
		IF(
		  	[User Activity - Exclude Cluster Admin] = TRUE, 
		    LEFT(ARRAY_INDEX($item, 1), 6) <> "admin-",
		    TRUE
		),
		IF(
		  	[User Activity - Exclude Guest Accounts] = TRUE, 
		    DB_LOOKUP("Type", "sys.Roles", HASH("Identity", ARRAY_INDEX($item, 1))) <> "GUEST",
		  	TRUE
		)
	)
);

LET $sorted :=  
ARRAY_SORTDESC(
	$filtered, 
	$(item) 
	ARRAY_INDEX($item, 2)
);

LET $scores := ARRAY_INDEX(ARRAY_TRANSPOSE($sorted), 2);
LET $average := AVERAGE($scores); 
LET $greatestScore := GREATEST($scores); 

LET $scored := 
ARRAY_SELECT(
	$sorted, $(i, item) 

	LET $username := ARRAY_INDEX($item, 1); 
	LET $systemActions := ARRAY_INDEX($item, 2); 
	LET $displayName := EBMS_GET_ROLE_DISPLAYNAME($username);


	//LET $statement := 
	//IF( 
	//	$systemActions > 250, "Very high activity",
	//	$systemActions > 100, "High activity", 
	//	$systemActions > 50, "Moderate-high activity",
	//	$systemActions > 20,  "Moderate activity",
	//	$systemActions > 10, "Low activity",
	//	"Very low activity"
	//);	

	RETURN 
	ARRAY(
		$username,
		$displayName,
		$systemActions,
		""//$statement
	)
);

LET $rows := 
ARRAY_SELECT(
	$scored, $(i, item)

	LET $statement := ARRAY_INDEX($item, 4);

	LET $colour := "black"; 

	RETURN 
	ARRAY_SELECT(
		$item, $(c, cell)
		HASH(
			"value", $cell, 
			"colour", $colour
		)
	)
);

LET $columns := 
ARRAY(
	HASH("heading", "Username", 			"width", 240),
	HASH("heading", "Display Name",	 	"width", 230),
	HASH("heading", "Last Login Date", 	"width", 230)
); 

RETURN 
HASH(
	"columns", $columns, 
	"rows", $rows
)
